import "./App.css";

function App() {
  return <div className="App"></div>;
}

function Header() {
  return (
    <header className="navbar_container">
      <div className="navbar_items">
        <div className="navbar_logo_container">
          <span>루미나LUMINA </span>
          <span>DesignLab</span>
        </div>
      </div>
    </header>
  );
}

export default App;
